prompt Creating A_SCHOOL...
create table A_SCHOOL
(
  dataid       NUMBER(11) not null,
  datasctlevel NUMBER(6) default -1,
  datastatus   NUMBER(6) default -1,
  keyword      VARCHAR2(200),
  istdate      DATE default sysdate,
  uptdate      DATE default sysdate,
  c1           VARCHAR2(120) not null,
  c2           VARCHAR2(120),
  c3           VARCHAR2(50),
  c4           VARCHAR2(120),
  c5           VARCHAR2(120),
  c6           VARCHAR2(120),
  c7           VARCHAR2(100),
  c8           VARCHAR2(50),
  c9           VARCHAR2(50),
  c10          VARCHAR2(200),
  c11          NUMBER(6),
  c12          VARCHAR2(200),
  c13          VARCHAR2(300),
  c14          VARCHAR2(30),
  c15          VARCHAR2(30)
)
tablespace TABLESPACE_PCACE
  pctfree 10
  initrans 1
  maxtrans 255
  storage
  (
    initial 16K
    next 1M
    minextents 1
    maxextents unlimited
  );

